import React from 'react'
import Widget from '../Widget/Widget'
import './Container.css'
export default function Container({list}) {
    return (
        <section id="container">
           <h1> {list.location}</h1>
           {    list.forecastDays
            .map((item) =>
            <Widget key = {Math.random()} daysummary={item.day_summary} alt=""></Widget>
           )}
        </section>
    )
}
